FUNCTION: ICAM proteins are ligands for the leukocyte adhesion protein LFA-1 (integrin alpha-L/beta-2). During leukocyte trans-endothelial migration, ICAM1 engagement promotes the assembly of endothelial apical cups through ARHGEF26/SGEF and RHOG activation. {ECO:0000269|PubMed:11173916, ECO:0000269|PubMed:17875742}.
FUNCTION: (Microbial infection) Acts as a receptor for major receptor group rhinovirus A-B capsid proteins. {ECO:0000269|PubMed:1968231, ECO:0000269|PubMed:2538243}.
FUNCTION: (Microbial infection) Acts as a receptor for Coxsackievirus A21 capsid proteins. {ECO:0000269|PubMed:11160747, ECO:0000269|PubMed:16004874, ECO:0000269|PubMed:9539703}.
FUNCTION: (Microbial infection) Upon Kaposi's sarcoma-associated herpesvirus/HHV-8 infection, is degraded by viral E3 ubiquitin ligase MIR2, presumably to prevent lysis of infected cells by cytotoxic T- lymphocytes and NK cell. {ECO:0000269|PubMed:11413168}.
SUBUNIT: Homodimer (Probable). Interacts with MUC1 and promotes cell aggregation in epithelial cells. Interacts with ARHGEF26/SGEF. Interacts (on T cell side) with CD81, CD247 and CD9 at immunological synapses between antigen-presenting cells and T cells. {ECO:0000269|PubMed:11173916, ECO:0000269|PubMed:12526797, ECO:0000269|PubMed:15099525, ECO:0000269|PubMed:17875742, ECO:0000269|PubMed:23858057, ECO:0000305}.
SUBUNIT: (Microbial infection) Interacts with major receptor group rhinovirus A-B capsid proteins (PubMed:1968231, PubMed:2538243). {ECO:0000269|PubMed:1968231, ECO:0000269|PubMed:2538243}.
SUBUNIT: (Microbial infection) Interacts with Coxsackievirus A21 capsid proteins (PubMed:11160747, PubMed:16004874, PubMed:9539703). {ECO:0000269|PubMed:11160747, ECO:0000269|PubMed:16004874, ECO:0000269|PubMed:9539703}.
INTERACTION: P20701:ITGAL; NbExp=2; IntAct=EBI-1035358, EBI-961214;
SUBCELLULAR LOCATION: Membrane; Single-pass type I membrane protein.
PTM: Monoubiquitinated, which is promoted by MARCH9 and leads to endocytosis.
POLYMORPHISM: Homozygotes with ICAM1-Kalifi Met-56 seem to have an increased risk for cerebral malaria [MIM:611162]. {ECO:0000269|PubMed:9259284}.
SIMILARITY: Belongs to the immunoglobulin superfamily. ICAM family. {ECO:0000305}.
