FUNCTION: Required for zonula adherens biogenesis and maintenance (PubMed:19041755). Acts via its interaction with CAMSAP3, which anchors microtubules at their minus-ends to zonula adherens, leading to the recruitment of KIFC3 kinesin to the junctional site (PubMed:19041755). Mediates docking of ADAM10 to zonula adherens through a PDZD11- dependent interaction with the ADAM10-binding protein TSPAN33 (PubMed:30463011). {ECO:0000269|PubMed:19041755, ECO:0000269|PubMed:30463011}.
SUBUNIT: Interacts with CAMSAP3 and CTNND1 (PubMed:19041755). Interacts (via WW domains) with TSPAN33 (via cytoplasmic domain) and with PDZD11; the interaction with TSPAN33 is dependent on PDZD11 being bound to PLEKHA7 and facilitates the docking of ADAM10 to zonula adherens through interaction of TSPAN33 with ADAM10 (PubMed:30463011). {ECO:0000269|PubMed:19041755, ECO:0000269|PubMed:30463011}.
