PTM: Phosphorylated by CHEK1 and MAPK14 at Ser-216. This phosphorylation creates a binding site for 14-3-3 protein and inhibits the phosphatase. Phosphorylated by PLK4. Phosphorylated by PLK1, leading to activate the phosphatase activity. Phosphorylation by PLK3 at Ser-191 promotes nuclear translocation. Ser-198 is a minor phosphorylation site. Was initially reported to be phosphorylated by PLK3 at Ser-216 (PubMed:10557092). However, such phosphorylation by PLK3 was not confirmed by other groups. Phosphorylation at Thr-48, Thr- 67, Ser-122, Thr-130, Ser-168 and Ser-214 occurs at G2 and G2-M transition and is probably catalyzed by CDK1. Ser-168 phosphorylation levels are lower than those at the other 5 CDK1 sites. Phosphorylation by CDK1 leads to increased activity. {ECO:0000269|PubMed:10557092, ECO:0000269|PubMed:11202906, ECO:0000269|PubMed:11333986, ECO:0000269|PubMed:14968113, ECO:0000269|PubMed:15150265, ECO:0000269|PubMed:15629715, ECO:0000269|PubMed:18239451, ECO:0000269|PubMed:8119945}.
SIMILARITY: Belongs to the MPI phosphatase family. {ECO:0000305}.
