FUNCTION: Appears to function predominantly as a heterodimeric complex with ILF3. This complex may regulate transcription of the IL2 gene during T-cell activation. It can also promote the formation of stable DNA-dependent protein kinase holoenzyme complexes on DNA. Essential for the efficient reshuttling of ILF3 (isoform 1 and isoform 2) into the nucleus. {ECO:0000269|PubMed:10574923, ECO:0000269|PubMed:11739746, ECO:0000269|PubMed:21123651, ECO:0000269|PubMed:9442054}.
SUBUNIT: Forms heterodimers with ILF3. ILF2-ILF3 heterodimers may also bind to PRKDC/XRCC7: this may stabilize the interaction of PRKDC/XRCC7 and the heterodimeric complex of G22P1/KU70 and XRCC5/KU80. Forms a complex with ILF3, YLPM1, KHDRBS1, RBMX, NCOA5 and PPP1CA. Identified in a IGF2BP1-dependent mRNP granule complex containing untranslated mRNAs. Interacts with IGF2BP1. {ECO:0000269|PubMed:10574923, ECO:0000269|PubMed:11739746, ECO:0000269|PubMed:17289661, ECO:0000269|PubMed:17890166, ECO:0000269|PubMed:9442054}.
INTERACTION: Q08752:PPID; NbExp=4; IntAct=EBI-357925, EBI-716596;
SUBCELLULAR LOCATION: Nucleus, nucleolus. Cytoplasm. Nucleus. Note=Localized in cytoplasmic mRNP granules containing untranslated mRNAs.
