 Interacts with SESN1 and SESN2 (PubMed:23274085). Interacts with NOTCH2 (PubMed:29149593). Component of the BCR(KLHL22) E3 ubiquitin ligase complex, at least composed of CUL3, KLHL22 and RBX1 (PubMed:23455478). {ECO:0000269|PubMed:10213691, ECO:0000269|PubMed:10230406, ECO:0000269|PubMed:10230407, ECO:0000269|PubMed:11337588, ECO:0000269|PubMed:11384984, ECO:0000269|PubMed:11961546, ECO:0000269|PubMed:12149480, ECO:0000269|PubMed:12481031, ECO:0000269|PubMed:12732143, ECO:0000269|PubMed:14739464, ECO:0000269|PubMed:15983046, ECO:0000269|PubMed:16678110, ECO:0000269|PubMed:18809579, ECO:0000269|PubMed:19112177, ECO:0000269|PubMed:19250909, ECO:0000269|PubMed:20596027, ECO:0000269|PubMed:22748924, ECO:0000269|PubMed:23274085, ECO:0000269|PubMed:23455478, ECO:0000269|PubMed:25349211, ECO:0000269|PubMed:29149593}.
