DISEASE: Neurofibromatosis 1 (NF1) [MIM:162200]: A disease characterized by patches of skin pigmentation (cafe-au-lait spots), Lisch nodules of the iris, tumors in the peripheral nervous system and fibromatous skin tumors. Individuals with the disorder have increased susceptibility to the development of benign and malignant tumors. {ECO:0000269|PubMed:10220149, ECO:0000269|PubMed:10336779, ECO:0000269|PubMed:10607834, ECO:0000269|PubMed:10712197, ECO:0000269|PubMed:10980545, ECO:0000269|PubMed:11258625, ECO:0000269|PubMed:11735023, ECO:0000269|PubMed:11857752, ECO:0000269|PubMed:12522551, ECO:0000269|PubMed:12552569, ECO:0000269|PubMed:12746402, ECO:0000269|PubMed:1302608, ECO:0000269|PubMed:15060124, ECO:0000269|PubMed:15146469, ECO:0000269|PubMed:15520408, ECO:0000269|PubMed:15523642, ECO:0000269|PubMed:15948193, ECO:0000269|PubMed:17160901, ECO:0000269|PubMed:21089070, ECO:0000269|PubMed:2114220, ECO:0000269|PubMed:21838856, ECO:0000269|PubMed:23758643, ECO:0000269|PubMed:24413922, ECO:0000269|PubMed:7981679, ECO:0000269|PubMed:8081387, ECO:0000269|PubMed:8544190, ECO:0000269|PubMed:8807336, ECO:0000269|PubMed:8834249, ECO:0000269|PubMed:9003501, ECO:0000269|PubMed:9101300, ECO:0000269|PubMed:9150739, ECO:0000269|PubMed:9298829, ECO:0000269|PubMed:9668168}. Note=The disease is caused by mutations affecting the gene represented in this entry.
DISEASE: Leukemia, juvenile myelomonocytic (JMML) [MIM:607785]: An aggressive pediatric myelodysplastic syndrome/myeloproliferative disorder characterized by malignant transformation in the hematopoietic stem cell compartment with proliferation of differentiated progeny. Patients have splenomegaly, enlarged lymph nodes, rashes, and hemorrhages. Note=The disease is caused by mutations affecting the gene represented in this entry.
DISEASE: Watson syndrome (WTSN) [MIM:193520]: A syndrome characterized by the presence of pulmonary stenosis, cafe-au-lait spots, and mental retardation. It is considered as an atypical form of neurofibromatosis. Note=The disease is caused by mutations affecting the gene represented in this entry.
DISEASE: Familial spinal neurofibromatosis (FSNF) [MIM:162210]: Considered to be an alternative form of neurofibromatosis, showing multiple spinal tumors. {ECO:0000269|PubMed:11704931}. Note=The disease is caused by mutations affecting the gene represented in this entry.
DISEASE: Neurofibromatosis-Noonan syndrome (NFNS) [MIM:601321]: Characterized by manifestations of both NF1 and Noonan syndrome (NS). NS is a disorder characterized by dysmorphic facial features, short stature, hypertelorism, cardiac anomalies, deafness, motor delay, and a bleeding diathesis. {ECO:0000269|PubMed:12707950, ECO:0000269|PubMed:16380919, ECO:0000269|PubMed:19845691}. Note=The disease is caused by mutations affecting the gene represented in this entry.
DISEASE: Colorectal cancer (CRC) [MIM:114500]: A complex disease characterized by malignant lesions arising from the inner wall of the large intestine (the colon) and the rectum. Genetic alterations are often associated with progression from premalignant lesion (adenoma) to invasive adenocarcinoma. Risk factors for cancer of the colon and rectum include colon polyps, long-standing ulcerative colitis, and genetic family history. Note=The gene represented in this entry may be involved in disease pathogenesis.
CAUTION: Was originally thought to be associated with LEOPARD (LS), an autosomal dominant syndrome. {ECO:0000305|PubMed:8807336}.
