SUBUNIT: The 26S proteasome consists of a 20S proteasome core and two 19S regulatory subunits. The 20S proteasome core is a barrel-shaped complex made of 28 subunits that are arranged in four stacked rings. The two outer rings are each formed by seven alpha subunits, and the two inner rings are formed by seven beta subunits. The proteolytic activity is exerted by three beta-subunits PSMB5, PSMB6 and PSMB7. {ECO:0000269|PubMed:25599644, ECO:0000269|PubMed:26133119, ECO:0000269|PubMed:27342858, ECO:0000269|PubMed:27428775, ECO:0000269|PubMed:27493187}.
