FUNCTION: Part of a multiprotein signaling complex which promotes phosphorylation of Raf family members and activation of downstream MAP kinases (By similarity). Independently of its kinase activity, acts as MAP2K1/MEK1 and MAP2K2/MEK2-dependent allosteric activator of BRAF; upon binding to MAP2K1/MEK1 or MAP2K2/MEK2, dimerizes with BRAF and promotes BRAF-mediated phosphorylation of MAP2K1/MEK1 and/or MAP2K2/MEK2 (PubMed:29433126). Promotes activation of MAPK1 and/or MAPK3, both in response to EGF and to cAMP (By similarity). Its kinase activity is unsure (By similarity). Some protein kinase activity has been detected in vitro, however the physiological relevance of this activity is unknown (By similarity). {ECO:0000250|UniProtKB:Q61097, ECO:0000269|PubMed:29433126}.
