DOMAIN: The protein kinase domain is predicted to be catalytically inactive. The domain is sufficient for KSR1 and KSR1-mediated MAP2K1 and MAP2K2 membrane localization. The domain is required but not sufficient for MAP kinase-mediated inhibition of ELK1 phosphorylation (PubMed:10409742). {ECO:0000255, ECO:0000269|PubMed:10409742}.
DOMAIN: The N-terminal region mediates interaction with BRAF (PubMed:29433126). Also mediates membrane localization (By similarity). {ECO:0000250|UniProtKB:Q61097, ECO:0000269|PubMed:29433126}.
PTM: Phosphorylated on Ser-311 and, to a higher extent, on Ser-406 by MARK3. Dephosphorylated on Ser-406 by PPP2CA. In resting cells, phosphorylated KSR1 is cytoplasmic and in stimulated cells, dephosphorylated KSR1 is membrane-associated. Phosphorylated by PKA at Ser-888. Phosphorylation at Ser-888 is required for cAMP-dependent activation of MAPK1 and/or MAPK3 (By similarity). {ECO:0000250|UniProtKB:Q61097}.
SIMILARITY: Belongs to the protein kinase superfamily. TKL Ser/Thr protein kinase family. {ECO:0000305}.
CAUTION: Although it belongs to the protein kinase superfamily, the ATP-binding motif VAIK has an arginine instead of a lysine residue suggesting that KSR1 can not bind ATP and therefore lacks protein kinase activity. However, KSR1 is capable of binding ATP (PubMed:29433126). Has protein kinase activity towards MAP2K1 in the presence of RAF1/c-RAF in vitro (By similarity). {ECO:0000250|UniProtKB:Q61097, ECO:0000269|PubMed:29433126, ECO:0000305}.
